var ZXGFILE0 = &quot;&quot;;

//数据加载完毕
function _thisOnpost_loaddata(sheet)
{
	ZXGFILE0 = _this.SaveTempZXGFile(0);
	_this.SetToDateBox(&quot;&quot;,0,2,12,G_LOGDAT.substring(0,8)+&quot;01&quot;);
	_this.SetToDateBox(&quot;&quot;,0,3,12,G_LOGDAT);

	//loadData();
	_this.SetAttribe(&quot;SHEET_0&quot;,_this.ATTR_SHEET_SELECTFLAG,_this.SELECTFLAG_SINGLEROW);
	_this.AutoFixScreenWidth();
}

function formatStr(str,len)
{
	var spaceStr = &quot;&quot;;
	var strlen = str.length;
	if (len &gt; strlen) {
		for (var i=0;i&lt;len-strlen;i++) {
			spaceStr += &quot; &quot;; //全角的空格
		}
		return spaceStr + str;
	}

	return str;
}

function loadData()
{
	var dat1 = _this.GetCellText(0,2,12);
	var dat2 = _this.GetCellText(0,3,12);

	_this.LoadZXGFile(ZXGFILE0,-1,0);
//	_this.SetFixedRow(0,1);

	_this.SetAttribe(&quot;SHEET_0&quot;,_this.ATTR_SHEET_SELECTFLAG,_this.SELECTFLAG_SINGLEROW);
	_this.SetMainCellRange(0,1,2,5,12);

	var xml = _sql.query(&quot;MAIN&quot;,&quot;DAT1=&quot;+dat1+&quot;&DAT2=&quot;+dat2);
	_this.SetXmlDS(0,7,1,9,_this.GetColCount(0)-1,xml);

	_this.SetToDateBox(&quot;&quot;,0,2,12,dat1);
	_this.SetToDateBox(&quot;&quot;,0,3,12,dat2);
	_this.SetCellText(0,4,3,dat1+&quot;至&quot;+dat2);

	_sql.querytods(&quot;TJDS&quot;,&quot;DAT1=&quot;+dat1+&quot;&DAT2=&quot;+dat2);
	var gxfz = _this.XMLDS_GetString(0,&quot;GX_FZ&quot;);
	var gxfm = _this.XMLDS_GetString(0,&quot;GX_FM&quot;);
	var gxbl = _this.XMLDS_GetString(0,&quot;GX_BL&quot;);
	var hzfz = _this.XMLDS_GetString(0,&quot;HZ_FZ&quot;);
	var hzfm = _this.XMLDS_GetString(0,&quot;HZ_FM&quot;);
	var hzbl = _this.XMLDS_GetString(0,&quot;HZ_BL&quot;);

	var gxstr = &quot;广西&quot;+formatStr(&quot;&quot;,6)+formatStr(gxfz,10)+formatStr(gxfm,12)+formatStr(gxbl,10);
	var hzstr = &quot;贺州&quot;+formatStr(&quot;&quot;,6)+formatStr(hzfz,10)+formatStr(hzfm,12)+formatStr(hzbl,10);
	_this.SetCellText(0,3,9,gxstr);
	_this.SetCellText(0,4,9,hzstr);

	_this.AutoFixScreenWidth();

}
